import unittest


def filter_minus_one(nums):
    rval = []
    i = 0
    while i < len(nums) - 2:
        j = 0
        while i+j < len(nums) - 1 and nums[i + j] == -1:
            j += 1
        if j > 3:
            if j % 2 == 0:
                rval.append(nums[i])
                rval.append(nums[i])
            if j % 2 == 1:
                rval.append(nums[i])
            i += j
        else:
            rval.append(nums[i])
            i += 1
    for j in range(i, len(nums)):
        rval.append(nums[j])
    return rval


class Solution(object):
    def maxProduct(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        # split on zeros
        nums_l = []
        cur_nums = []

        for i in range(len(nums)):
            if nums[i] == 0:
                if cur_nums:
                    nums_l.append(cur_nums)
                    nums_l.append([0])
                    cur_nums = []
            else:
                cur_nums.append(nums[i])
        if cur_nums:
            nums_l.append(cur_nums)

        if not nums_l:
            return 0
        return max([self.maxProductHelper(num_l) for num_l in nums_l])

    def maxProductHelper(self, nums):
        if not nums:
            return 0
        # merge ones
        if not max(nums) == 1:
            nums = [num for num in nums if num != 1]
        # remove minus ones
        nums =  filter_minus_one(nums)
        if not nums:
            return 0
        d = {(i, i+1): nums[i] for i in range(len(nums))}
        for i in range(len(nums)):
            for j in range(i + 2, len(nums) + 1):
                d[i, j] = d[i, j -1] * d[j - 1, j]

        return max(d.values())


class SolutionTest(unittest.TestCase):
    def test_1(self):
        self.assertEqual(Solution().maxProduct([2,3,-2,4]), 6)

    def test_2(self):
        self.assertEqual(Solution().maxProduct([1,2,3,0,8]), 8)

    def test_3(self):
        self.assertEqual(Solution().maxProduct([-4,-3]), 12)

    def test_0(self):
        self.assertEqual(Solution().maxProduct([0,0,0]), 0)

    def test_5(self):
        self.assertEqual(Solution().maxProduct([-2,0,-1]), 0)

    def test_6(self):
        self.assertEqual(Solution().maxProduct([-3,0,1,-2]), 1)

